deck_description:
Combo When you have a lumina lightsworn summoner and raiden hand of the lightsworn and solar recharge plus charge of the light brigade.You first want to use solar recharge to discard a raiden hand of the lightsworn to draw two and you might get a card which can be special summon by banishing and you also have to send top two cards in your deck to the graveyard so you might get a dark in the graveyard so then you charge of the charge of the light brigade to send top three cards from you deck to the grave then with the other effect of charge of the light brigade which you will use to add Felis,lightswron Archer so then you will summon a lumina lightsworn summoner the use its effect to discard Felis,lightswron Archer so then you can special summon raiden hand of the lightsworn then Felis,lightswron effect will activate to special summon the card itself and with the raiden hand of the lightsworn you special summon with lumina lightsworn summoner then you will use raiden hand of the lightsworn effect to send top two cards from your deck to your grave so then you will link summon by using them all to link summon their link 3 Curious the lightsworn Dominion and use its effect to send chaos dragon levianeer then the Curious the lightsworn Dominion effect will activate to send the top 3 cards to the grave then you have a 50% chance for a starlige seyfert then you will use its effect to add back chaos dragon levianeer back to your hand. I'm not going to tell you all of the other combos because their easy to find out on your own but this one combo I showed to you guys is the best one of them all.I work so hard on this deck so I hope you guys like it enjoy :).

Oh almost forgot this deck is better going second to OTK your opponent and tell me in the comments what other decks you want me to make.

&nbsp;

Diese Deck ist so gemacht, dass der Gegner nicht mehr zum atmen kommt :)

&nbsp;

&nbsp;

Wünsche euch viel Spaß mit meinen Deck

Gameplay of the deck :

&nbsp;

<a class="style-scope ytcp-video-metadata-info" href="https://youtu.be/VJ3e9ZwCZjg" target="_blank" rel="noopener noreferrer nofollow">https://youtu.be/VJ3e9ZwCZjg</a>

Typical strategy is summon <a data-name="accel synchron">accel synchron</a>, drop <a data-name="bri synchron">bri synchron</a> into the grave to get accel to level 9, and from there, with a true king, you can go into calamities, phantasmal lord, or ultimaya depending on what you want to do. Even Heart-eartH is an option if you have another true king.

Considering how it goes, i might change the yang zing paths for pot of avarice as it can cycle both bri and accel aswell, but if can't be used with the darkness of yang zing either.

&nbsp;

Have fun!

